    "### Panel Data Analysis"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "cf070112",
   "metadata": {
    "papermill": {
     "duration": 0.031778,
     "end_time": "2024-04-10T16:14:38.408090",
     "exception": false,
     "start_time": "2024-04-10T16:14:38.376312",
     "status": "completed"
