   "source": [
    "The plots we are interested in are residuals vs fitted values and standardised residuals on Y axis. If there is absolutely no heteroscedastity, you should see a completely random, equal distribution of points throughout the range of X axis and a flat red line.\n",
    "\n",
    "But in our case, as you can notice from the residuals vs fitted values plot, the red line is slightly curved and the residuals seem to increase as the fitted Y values increase. So, the inference here is, heteroscedasticity exists."
   ]
